(function($,window,Drupal){Drupal.behaviors.webformBlockSettingsSummary={attach:function(){if(typeof $.fn.drupalSetSummary==='undefined'){return}
function selectSummary(context){return $(context).find('#edit-visibility-webform-webforms option:selected').map(function(){return Drupal.checkPlain(this.text)}).get().join(', ')||Drupal.t('Not restricted')}
$('[data-drupal-selector="edit-visibility-webform"]').drupalSetSummary(selectSummary)}}})(jQuery,window,Drupal)